import React from "react";
import Sdata from "./Sdata";
import Card from "./Card";

const Other =()=>{
    return(
    <Card
                key={Sdata[3].id}
                imgsrc={Sdata[3].imgsrc}
                cardTitle={Sdata[3].cardTitle}
                link={Sdata[3].link}
            />
    )
}

export default Other;
